def bubble_sort(lst):
  for counter in range(len(lst)-1,0,-1):
    for i in range(0,counter):
      if lst[i] > lst[i+1]:
        lst[i],lst[i+1]=lst[i+1],lst[i]
  return lst

def insertion_sort(lst):
  for counter in range(1,len(lst)):
    while counter-1 >= 0:
      if lst[counter] < lst[counter-1]:
        lst[counter],lst[counter-1]=lst[counter-1],lst[counter]
        counter-=1
      else:
        break
  return lst

